package com.kasite.client.order.bean.dbo;import java.sql.Timestamp;import javax.persistence.Id;import javax.persistence.Table;
/** * @author linjianfa * @Description:  退费订单实体类 * @version: V1.0   * 2017-7-13 下午6:54:03 */@Table(name="O_REFUNDORDER")public class RefundOrder{ 	/**支付订单号*/ 	private String orderId; 	/**退费订单号*/	@Id 	private String refundOrderId; 	/**退费金额*/ 	private Integer refundPrice; 	/**退费金额*/ 	private String channelId; 	/**操作者ID*/ 	private String operatorid; 	/**操作者ID*/ 	private String operatorName; 	/**备注*/ 	private String remark; 	/** 退款状态:3退费申请中 4退费完成 7退费失败  */ 	private Integer payState; 	/**开始时间*/ 	private Timestamp beginDate; 	/**结束时间*/ 	private Timestamp endDate; 	/**退款流水号*/ 	private String refundNo; 	/**退费重试次数*/ 	private Integer retryNum;	 	private Integer totalPrice; 	 	private String outRefundOrderId; 		public String getOutRefundOrderId() {		return outRefundOrderId;	}	public void setOutRefundOrderId(String outRefundOrderId) {		this.outRefundOrderId = outRefundOrderId;	}	public Integer getTotalPrice() {		return totalPrice;	}	public void setTotalPrice(Integer totalPrice) {		this.totalPrice = totalPrice;	}	public Integer getRetryNum() {		return retryNum;	}	public void setRetryNum(Integer retryNum) {		this.retryNum = retryNum;	}	public String getOrderId() {		return orderId;	}	public void setOrderId(String orderId) {		this.orderId = orderId;	}	public String getRefundOrderId() {		return refundOrderId;	}	public void setRefundOrderId(String refundOrderId) {		this.refundOrderId = refundOrderId;	}	public Integer getRefundPrice() {		return refundPrice;	}	public void setRefundPrice(Integer refundPrice) {		this.refundPrice = refundPrice;	}	public String getChannelId() {		return channelId;	}	public void setChannelId(String channelId) {		this.channelId = channelId;	}	public String getOperatorid() {		return operatorid;	}	public void setOperatorid(String operatorid) {		this.operatorid = operatorid;	}	public String getOperatorName() {		return operatorName;	}	public void setOperatorName(String operatorName) {		this.operatorName = operatorName;	}	public String getRemark() {		return remark;	}	public void setRemark(String remark) {		this.remark = remark;	}	public Integer getPayState() {		return payState;	}	public void setPayState(Integer payState) {		this.payState = payState;	}	public Timestamp getBeginDate() {		return beginDate;	}	public void setBeginDate(Timestamp beginDate) {		this.beginDate = beginDate;	}	public Timestamp getEndDate() {		return endDate;	}	public void setEndDate(Timestamp endDate) {		this.endDate = endDate;	}	public String getRefundNo() {		return refundNo;	}	public void setRefundNo(String refundNo) {		this.refundNo = refundNo;	}		}